import { useEffect } from 'react';

function fetchPokeList(list, ...ids) {
  const select = document.getElementById("pokeList"+list);

  ids.forEach((id) => {
    const option = document.createElement("option");
    option.value = id;
    option.textContent = `Pokemon ${id}`;
    select.appendChild(option);
  });
}

function Fuse() {
  useEffect(() => {
    fetchPokeList(1, 2, 3, 4, 5); // przykład
  }, []);

  return (
    <div>
      <select id="pokeList1"></select>
      <select id="pokeList2"></select>
    </div>
    
  );
}

export default Fuse;
